    playbackData.comments = {"2270e025-7062-4201-a424-d00a5faf6047":[{"id":"57b6bc31-6f27-4fcb-aff2-52324800fdaf","displayCommentEventId":"2270e025-7062-4201-a424-d00a5faf6047","displayCommentEventSequenceNumber":0,"developerGroupId":"10784780-89f0-4059-9a58-242a3207c06a","timestamp":1727379051663,"commentText":"A playback introducing the concepts of tidy data and pivoting, introducing the <span style=\"font-family: Courier;\">pivot_longer()</span> function.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"284acf73-61ea-4f6b-9487-b53cbd4b1b11":[{"id":"6ea3049f-1b98-42b2-8b2a-b7f7aa1e8578","displayCommentEventId":"284acf73-61ea-4f6b-9487-b53cbd4b1b11","displayCommentEventSequenceNumber":61,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727452689091,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1727457801239-TidyData.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"7acc3453-88c2-42e8-a6b3-c6538b362e7a":[{"id":"34d2f2dc-27cd-4025-87d9-3b97e3eae522","displayCommentEventId":"7acc3453-88c2-42e8-a6b3-c6538b362e7a","displayCommentEventSequenceNumber":200,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727453533953,"commentText":"The first image below gives a visual of how the data in <span style=\"font-family: Courier;\">grades</span> is formatted.&nbsp; This format is probably particularly easy for the user to enter, but it isn't at all easy to search.&nbsp; If I wanted to search my data for all students who got an A on at least 2 assignments, for instance, this is nearly impossible <span style=\"font-style: italic;\">in this format.</span>&nbsp; Enter data tidying.<div><br></div><div>The second image below shows what we might want the data to look like internally when we are done tidying.&nbsp; We will make progress toward this table in this playback, but we will need to work further to reach this end state.&nbsp; In this ideal state, each <span style=\"font-style: italic;\">observation</span> (row) corresponds to one graded item from the course.&nbsp; Each column is a <span style=\"font-style: italic;\">variable</span>&nbsp;or property we know about a graded assignment.&nbsp; Each cell is the <span style=\"font-style: italic;\">value</span> attributed to that graded item in that category.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1727453319591-HwView.PNG","media/images/1727453324246-HwGoals.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"045af362-6f54-4a28-9ca4-7604bc86e1a7":[{"id":"ac3596ee-a40c-4ae7-a03d-79e107fb606f","displayCommentEventId":"045af362-6f54-4a28-9ca4-7604bc86e1a7","displayCommentEventSequenceNumber":241,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727453834474,"commentText":"As you could see in the previous story point, our ideal data frame is much longer than our original data frame, as instead of thinking of each row as a person, we are thinking of each row as a graded item in the course.&nbsp; We will therefore be working with the <span style=\"font-family: Courier;\">pivot_longer()</span> function today.&nbsp;<div><br></div><div>When we use <span style=\"font-family: Courier;\">pivot_longer()</span>, it is typically because there are things we are thinking of as values that have ended up in columns.&nbsp; The first argument to the <span style=\"font-family: Courier;\">pivot_longer() </span>function is <span style=\"font-family: Courier;\">cols</span>.&nbsp; What we put the the right of <span style=\"font-family: Courier;\">cols </span>is either an individual column or a list of column names that contain values.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"9dd3dff8-ef8f-43b9-aa11-62a8984d8e07":[{"id":"09a2461e-345c-49f2-b29b-1d8830dd43f7","displayCommentEventId":"9dd3dff8-ef8f-43b9-aa11-62a8984d8e07","displayCommentEventSequenceNumber":262,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727454321751,"commentText":"A function we have not seen before is <span style=\"font-family: Courier;\">starts_with()</span>, which can select all columns in a data frame that start with the designated character vector you pass in.&nbsp; Here, we pass in <span style=\"font-family: Courier;\">\"hw\"</span> to indicate that for now, the only change we will be making is to the homework columns.<div><br></div><div>As another example, if we wanted to identify the <span style=\"font-family: Courier;\">type1</span> and <span style=\"font-family: Courier;\">type2</span> columns in the <span style=\"font-family: Courier;\">pokemon</span> data, we could have typed either<span style=\"font-family: Courier;\"> c(type1,type2) </span>or we could use <span style=\"font-family: Courier;\">starts_with(\"type\")</span>.&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["argument","cols","pivot_longer","question"],"questionCommentData":{"allAnswers":["1","3","9","12"],"correctAnswer":"3","question":"Just to confirm: how many columns are identified with <span style=\"font-family: Courier;\">starts_with(\"hw\")</span>?","explanation":"Just the columns <span style=\"font-family: Courier;\">hw_1, hw_2</span>, and <span style=\"font-family: Courier;\">hw_3</span> are selected here."}}],"104c493b-31b9-4670-a97a-c9cb966c5be8":[{"id":"fee6b46e-d3d1-476b-bf99-63b70d83c969","displayCommentEventId":"104c493b-31b9-4670-a97a-c9cb966c5be8","displayCommentEventSequenceNumber":331,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727454531505,"commentText":"The columns headers identified with <span style=\"font-family: Courier;\">cols </span>will now become values in the data frame that is ultimately output by the <span style=\"font-family: Courier;\">pivot_longer()</span> function.&nbsp; The <span style=\"font-family: Courier;\">names_to</span> argument is asking what we would like the name of the NEW column to be that holds these column headers.&nbsp; We have decided on the name hw_number, and have passed this name in as a character vector (between quotes).","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["argument","names_to","pivot_longer"],"questionCommentData":null}],"96a71816-6d3b-4d6a-8fab-707da44b155b":[{"id":"5f6834be-cf84-465d-98d9-997ed5a71538","displayCommentEventId":"96a71816-6d3b-4d6a-8fab-707da44b155b","displayCommentEventSequenceNumber":380,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727454806409,"commentText":"If the column names are going to be placed in a new column, what is to happen of the values held in those existing columns?&nbsp; This is where the third argument to the<span style=\"font-family: Courier;\"> pivot_longer()</span> function comes in: <span style=\"font-family: Courier;\">values_to</span>.&nbsp; The values in the affected columns will be grouped with the column name and placed in a new column.&nbsp;&nbsp;<div><br></div><div>Since the value in the cell of a given row in a <span style=\"font-family: Courier;\">hw_n</span> column is a homework score, we choose to call this new column <span style=\"font-family: Courier;\">hw_score</span> (again, the syntax is to pass in the new name as a character vector).</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["arguments","pivot_longer","values_to"],"questionCommentData":null}],"aa609e95-10f8-4c56-af4f-e4ee99029a02":[{"id":"8c9a8d85-e9f1-4218-b58f-ee37a61d6e00","displayCommentEventId":"aa609e95-10f8-4c56-af4f-e4ee99029a02","displayCommentEventSequenceNumber":470,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727455455196,"commentText":"Remember that when we transform data, new columns are added by default to the end of the data frame. The <span style=\"font-family: Courier;\">pivot_longer()</span> function does NOT have any arguments for where we wish to place the new columns - they will be at the end.<div><br></div><div>If we wish to make sure we get to see the new columns, we can relocate them via the <span style=\"font-family: Courier;\">relocate()</span> function.&nbsp; Inside of relocate(), we list the columns to relocate, and where we want them relocated to.&nbsp; Here, we use <span style=\"font-family: Courier;\">.before</span>, as we did with <span style=\"font-family: Courier;\">mutate()</span>, to place the two columns <span style=\"font-family: Courier;\">hw_number</span> and <span style=\"font-family: Courier;\">hw_score</span> right before the third column in the data frame.&nbsp; An image of the output of this is shown below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1727455452211-hw2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"cd9939de-07c0-4973-a1a6-33a8427040aa":[{"id":"60cbd7a0-1730-4b53-a078-4c629db67bd9","displayCommentEventId":"cd9939de-07c0-4973-a1a6-33a8427040aa","displayCommentEventSequenceNumber":516,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727458023539,"commentText":"Sometimes, multiple column headers are there because some data entries had secondary or tertiary values, while others did not.&nbsp; If we pivot() and turn each value into part of an observation, this sometimes includes NA values in a column.&nbsp; If instead of creating a row with an NA value, you'd rather just omit the data, you can do that be setting the <span style=\"font-family: Courier;\">pivot_longer()</span>'s optional <span style=\"font-family: Courier;\">value_drop_na</span> argument to <span style=\"font-family: Courier;\">TRUE</span>.<div><br></div><div>Notice that since Katniss Everdeen didn't submit an assignment for <span style=\"font-family: Courier;\">hw_1</span>, we probably don't need to keep track of that with a row for something that doesn't exist.&nbsp; We will know she did not submit a <span style=\"font-family: Courier;\">hw_1</span> by it not existing in the table.&nbsp; She now only has two rows in the resulting column, while the other students have three.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1727457831535-hw3.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["image","na","pivot_longer","value_drop_na"],"questionCommentData":null}],"228b25e2-7edc-462a-bbd1-3698b07795ab":[{"id":"aa1b09ab-d1d1-479e-b0cc-48cd49d9c1b6","displayCommentEventId":"228b25e2-7edc-462a-bbd1-3698b07795ab","displayCommentEventSequenceNumber":577,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727458194453,"commentText":"Given that the title of the column is <span style=\"font-family: Courier;\">homework_number,</span> we probably don't need the hw_ prefix actually in the column; the number is the only important part.&nbsp; The <span style=\"font-family: Courier;\">parse_number()</span> function takes from a character vector the largest first whole number it finds in the character vector.&nbsp; Here, that extracts just the homework number and exactly serves our purposes.&nbsp; This would also allow us to recognize the values in the column as numerical to sort and graph properly.&nbsp; The image below shows this change.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1727458173181-hw4.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["parse_number","image"],"questionCommentData":null}],"46a17ee8-1e40-4ef6-84a9-78d5bf06afef":[{"id":"0d8b239c-2ec0-41be-8e14-eadd81a066da","displayCommentEventId":"46a17ee8-1e40-4ef6-84a9-78d5bf06afef","displayCommentEventSequenceNumber":777,"developerGroupId":"f2d9d383-e56d-4a5b-8bf9-090829a48662","timestamp":1727458508957,"commentText":"Last but not least, note that we can often return to the original data format or at least something close to it with the operations we know.&nbsp;&nbsp;<div><br></div><div>Before, one row of data was corresponding to one student.&nbsp; After pivoting, each row represents one assignment.&nbsp; If we wish to return to a view where we condense items according to students, we can use <span style=\"font-family: Courier;\">group_by()</span> to accomplish this.&nbsp;</div><div><br></div><div>&nbsp;Because our data is more easily formatted for R, doing something like summing the homework scores is easy now.&nbsp; Also note that by dropping the <span style=\"font-family: Courier;\">NA</span> value, we were able to sum Katniss' homework scores, while also noting she is missing an assignment!</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1727458462978-hw5.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer1.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}]};
